if (components.formatFilter.values.length > 0) {
  if (components.authorFilter.values.length > 0) {
    return queries.getBooksDetails.data.result.filter(
      (row) =>
        components.formatFilter.values.includes(row.library_resources_format) &&
        components.authorFilter.values.includes(row.library_resources_author)
    );
  } else {
    return queries.getBooksDetails.data.result.filter((row) =>
      components.formatFilter.values.includes(row.library_resources_format)
    );
  }
} else if (components.authorFilter.values.length > 0) {
  return queries.getBooksDetails.data.result.filter((row) =>
    components.authorFilter.values.includes(row.library_resources_author)
  );
} else {
  return queries.getBooksDetails.data.result;
}
